script: |
  super -f text -I q9968.spq | sort > q9968.out

inputs:
  - name: q9968.spq
    data: |
      SELECT DISTINCT 94 * 94 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 - 34 - - col0 BETWEEN ( + col1 * - col2 + col2 * + col2 ) AND + 76 + - col1;
  - name: tab1

outputs:
  - name: q9968.out
    data: |
      8836
